INSERT INTO `texte` (`id`, `contenu`, `nomtexte`) VALUES
(2, 'BIENVENU SUR LA PLATEFORME DE TOURISME DU BURKINA-FASO', 'titre'),
(3, 'Le Burkina Faso a accueilli 106.000 de touristes en 2021, ce qui\r\n                     les place au 159e rang mondial en termes absolus.\r\nIl est évident que les petits pays sont régulièrement moins bien classés dans une comparaison\r\n du nombre absolu de visiteurs. Si l\'on rapporte le nombre de touristes au nombre d\'habitants\r\n  du Burkina Faso, on obtient une image un peu plus comparable : avec 0,0047 touristes par \r\n  habitant, le Burkina Faso se situait au 193e rang mondial. En Afrique de l\'Ouest, à la 12e\r\n   place, derrière Mauritanie.\r\n\r\nEn 2020, le Burkina Faso a ainsi généré environ 112,06 millions d\'euros dans le seul secteur du\r\n tourisme. Cela correspond à 0,62 % du produit intérieur brut et à environ 7 % de toutes les\r\n  recettes touristiques internationales en Afrique de l\'Ouest.', 'par1'),
(4, 'Évolution du secteur du tourisme en Burkina Faso de 1995 à 2020', 'evolution'),
(5, 'Le graphique ci-dessous montre le nombre de touristes étrangers enregistrés chaque \r\n    année en Burkina Faso. Un touriste est une personne qui passe au moins une nuit dans le\r\n     pays, mais qui n\'y vit pas plus de 12 mois. Dans la mesure où l\'enquête comprenait également\r\n      l\'objet du voyage, les voyages d\'affaires et les autres motifs de voyage non touristiques\r\n       ont déjà été filtrés. Le nombre de personnes en transit au cours de la même journée et,\r\n        par exemple, les membres d\'équipage de bateaux ou d\'avions, n\'est pas non plus considéré\r\n         comme un but touristique dans la plupart des pays. Si une même personne entre et sort\r\n          plusieurs fois au cours d\'une année, chaque visite compte à nouveau.', 'graph1'),
(6, 'Évolution des recettes touristiques', 'evolution2'),
(7, 'En 2000, les recettes du tourisme s\'élevaient à 24,90 millions d\'euros, soit environ\r\n             0,77 % du produit national brut. En l\'espace de 20 ans, la dépendance du pays vis-à-vis\r\n              du tourisme s\'est sensiblement accrue. Avant l\'apparition de la pandémie Covid-19, le\r\n               chiffre d\'affaires de 154,53 millions d\'euros représentait 1,1 pour cent du produit\r\n                national brut.\r\nEn 2020, le chiffre d\'affaires généré par les touristes s\'est effondré en raison de la pandémie de\r\n Corona. Sur les 154,53 millions d\'euros (2019), il ne restait plus que 112,06 millions d\'euros.\r\n  En Burkina Faso, cela représente une baisse de 27 %.\r\n\r\nEn moyenne, chacun des touristes arrivés en 2020 a dépensé environ 1.673 euros.', 'graph2'),
(8, 'LES SITES TOURISTIQUES DU BURKINA-FASO', 'site'),
(9, 'La grande mosquee de Dioulassoba', 'mosquee'),
(10, 'La mosquée qui réunit environ 400 personnes à chaque prière, est soutenue \r\n                par des poteaux en bois. La totalité du bâtiment est en banko – mélange\r\n                 homogène d’argile, de sable fin et d’éléments organiques. Le coût des \r\n                 travaux de réhabilitation tourne autour de 500 millions de francs CFA.\r\n                  Le gouvernement a mis 150 millions à disposition du comité de rénovation,\r\n                   les fidèles sont censés réunir la somme restante. Jusqu’ici, 291 millions\r\n                    ont été collectés.\r\n\r\nPour Hamadou Sanogo, cette rénovation est aussi l’occasion d’envisager de nouvelles constructions\r\n sur le site de la mosquée. « Le comité de réhabilitation veut construire des hangars, les pavages,\r\n  les toilettes, mais aussi une passerelle pour permettre aux touristes d’accéder au haut de la mosquée »,\r\n   explique-t-il.', 'par_mosque'),
(11, 'ajouter', 'ajouter'),
(12, 'Les caimans sacres de Sabou', 'titre_caiman'),
(13, 'Sabou est un département du Burkina Faso située dans la province du Boulkiemdé et dans la région\r\n     Centre-Ouest. En 2006, le dernier recensement comptabilise 45 877 habitants\r\n\r\nLes crocodiles sacrés de Sabou. Ils sont plus d’une centaine et vivent dans une mare depuis des siècles au\r\n côté nord de Sabou. Pour avoir sauvé la vie de leur ancêtre chasseur, les descendants de la famille Kaboré\r\n  et tout le village de Sabou avec, vénèrent ces crocodiles.\r\n\r\n« Ces crocodiles représentent les âmes des descendants de la famille Kaboré à Sabou », affirme Kuilga Kaboré,\r\n guide depuis 1989. Aujourd’hui ces « autres habitants » de Sabou constituent une véritable attraction touristique.\r\n  Au bord de la mare, un poulet suffit à les faire sortir de l’eau pour une partie de photos. Il est possible de \r\n  poser à côté d’un crocodile ou de soulever sa queue sans aucun risque.\r\n\r\nCes crocodiles sont bien protégés. Dans la journée les guides accompagnent les visiteurs qui veulent les voir \r\net la nuit des gardiens les suivent de près. Sur les lieux il existe des infrastructures hôtelières pour accueillir\r\n et héberger les visiteurs. Manger, boire, dormir et profiter paisiblement de l’air naturel, c’est possible à la mare\r\n  aux crocodiles sacrés de Sabou.', 'par_caiman'),
(14, 'La place THOMAS SANKARA', 'titre_sankara'),
(15, 'La mosquée qui réunit environ 400 personnes à chaque prière, est soutenue \r\n                par des poteaux en bois. La totalité du bâtiment est en banko – mélange\r\n                 homogène d’argile, de sable fin et d’éléments organiques. Le coût des \r\n                 travaux de réhabilitation tourne autour de 500 millions de francs CFA.\r\n                  Le gouvernement a mis 150 millions à disposition du comité de rénovation,\r\n                   les fidèles sont censés réunir la somme restante. Jusqu’ici, 291 millions\r\n                    ont été collectés.\r\n\r\nPour Hamadou Sanogo, cette rénovation est aussi l’occasion d’envisager de nouvelles constructions\r\n sur le site de la mosquée. « Le comité de réhabilitation veut construire des hangars, les pavages,\r\n  les toilettes, mais aussi une passerelle pour permettre aux touristes d’accéder au haut de la mosquée »,\r\n   explique-t-il.', 'par_sankara'),
(16, 'Les cascades de Banfora', 'titre_cascade'),
(17, 'La mosquée qui réunit environ 400 personnes à chaque prière, est soutenue \r\n                par des poteaux en bois. La totalité du bâtiment est en banko – mélange\r\n                 homogène d’argile, de sable fin et d’éléments organiques. Le coût des \r\n                 travaux de réhabilitation tourne autour de 500 millions de francs CFA.\r\n                  Le gouvernement a mis 150 millions à disposition du comité de rénovation,\r\n                   les fidèles sont censés réunir la somme restante. Jusqu’ici, 291 millions\r\n                    ont été collectés.\r\n\r\nPour Hamadou Sanogo, cette rénovation est aussi l’occasion d’envisager de nouvelles constructions\r\n sur le site de la mosquée. « Le comité de réhabilitation veut construire des hangars, les pavages,\r\n  les toilettes, mais aussi une passerelle pour permettre aux touristes d’accéder au haut de la mosquée »,\r\n   explique-t-il.', 'par_cascade'),
(18, 'les sites de Laongo', 'titre_laongo'),
(19, 'Le Burkina Faso regorge d\'un riche patrimoine culturel et touristique,\r\n         ce qui en fait une destination privilégiée des touristes nationaux\r\n          et internationaux. L\'une des nombreuses attractions touristiques\r\n           qui forcent l\'admiration des touristes est sans aucun doute les\r\n            sculptures sur granite de Laongo.\r\n\r\nLa création du site touristique est née de l\'initiative d\'artistes locaux \r\nqui étaient en quête d’un lieu propice d’expression artistique.\r\n\r\nLe projet a été présenté par le Comité national des arts plastiques du \r\nBurkina Faso en 1988 et a été approuvé par les pouvoirs publics à la même date.\r\n\r\nLe village de Laongo a été désigné comme le lieu idéal pour les créations \r\nartistiques. Le site présente un relief accidenté couvert de blocs de roche en \r\ngranite, idéal pour les sculptures de tous genres.\r\n\r\nLes œuvres d\'art sont taillées directement sur la roche, ce qui leurs confèrent\r\n une originalité unique d’où l\'appellation du site \"Les sculptures sur granite de Laongo\".\r\n\r\nLe site rassemble plusieurs œuvres d\'art d\'artistes nationaux et étrangers.\r\n\r\nÀ ce jour, il existe plus de deux (200) cent types de créations artistiques impliquant\r\n différents thèmes de société.\r\n\r\nChaque année, des artistes du monde entier sont invités à participer à un symposium qui \r\na lieu sur le site de Laongo. C’est l’occasion pour les participants d’exprimer leur \r\ncréativité en laissant parler leur imagination sur les blocs de roche.', 'par_laongo'),
